import React from 'react';
import Header from '../header';
//import BurgerMenu from '../burger-menu';

export default class App extends React.Component {
    onBtnHandler = () => {
        console.log('test');
    }
    render() {
        
        
        return (
            <div>
                <Header 
                    onBtnClickHandler = {this.onBtnHandler} menu={this.menu}/>
            </div>
        );
    };
};
